    @include onLaptop {
      justify-content: flex-start;
      margin: 0 0 32px 10px;
    }
  }

  &__arrows-left {
    display: inline-block;
    width: 10px;
    height: 10px;

    margin-right: 40px;

    border-top: 1px solid $colorGrey;
    border-left: 1px solid $colorGrey;

    transform: rotate(-45deg);

    @include onTablet {
      margin-right: 45px;
    }
  }

  &__arrows-right {
    display: inline-block;
    width: 10px;
    height: 10px;

    border-top: 1px solid $colorGrey;
    border-right: 1px solid $colorGrey;

    transform: rotate(45deg);
  }

  &__button {
    padding: 0 20px;

    @include onTablet {
      width: max-content;
      margin: 0 auto;
      padding: 0;
    }
  }

  &__top-actions {
    display: block;

    @include onLaptop {
      display: grid;
    }
  }
